  GraphCommons.Helper.addData = function (graph) {

    obj.graph.edges.forEach(function (edge) {
      graph.addLink(edge.from, edge.to);
    });

  };

  GraphCommons.Helper.sigmaAddData = function (g) {

    obj.graph.nodes.forEach(function (node) {
      g.nodes.push({
        id: node.id,
        label: node.name,
        x: -40 + Math.random() * 20.0,
        y: -40 + Math.random() * 20.0,
        size: 1,
        color: '#00f'
      });
    });

    obj.graph.edges.forEach(function (edge) {
      g.edges.push({
        id: edge.id,
        source: edge.from,
        target: edge.to,
        color: '#f00',
        weight: edge.weight
      });
    });
  };

